    //-----------------------------------------------------------------------------
    // Name: DrawSphere()
    // Desc: 
    //-----------------------------------------------------------------------------
    inline void DrawSphere() {
        static GLuint s_vao = 0;
        if (s_vao == 0) {
            // Lazy initialization of VBO with sphere polygon mesh
            glGenVertexArrays(1, &s_vao);
            glBindVertexArray(s_vao);
                GLuint vbo = 0;
                glGenBuffers(1, &vbo);
                glBindBuffer(GL_ARRAY_BUFFER, vbo);
                glBufferData(GL_ARRAY_BUFFER, sizeof(Mesh::SPHERE), Mesh::SPHERE, GL_STATIC_DRAW);
                glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 8*sizeof(GLfloat), (const void *) 0);
                glVertexAttribPointer(1, 3, GL_FLOAT, GL_FALSE, 8*sizeof(GLfloat), (const void *) (3 * sizeof(GLfloat)));
                glVertexAttribPointer(2, 2, GL_FLOAT, GL_FALSE, 8*sizeof(GLfloat), (const void *) (6 * sizeof(GLfloat)));
                glEnableVertexAttribArray(0);
                glEnableVertexAttribArray(1);
                glEnableVertexAttribArray(2);
                // glBindBuffer(GL_ARRAY_BUFFER, 0);
            glBindVertexArray(0);
            glDeleteBuffers(1, &vbo);
        }
        glBindVertexArray(s_vao);
        glDrawArrays(GL_TRIANGLES, 0, sizeof(Mesh::SPHERE) / (8*sizeof(GLfloat)));
        glBindVertexArray(0);
    }
